import React from 'react';
import { Routes, Route, useNavigate } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import {
  Box,
  Drawer,
  AppBar,
  Toolbar,
  Typography,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  IconButton,
  useMediaQuery,
} from '@mui/material';
import {
  Dashboard as DashboardIcon,
  EventNote as EventNoteIcon,
  Settings as SettingsIcon,
  Description as DescriptionIcon,
  Menu as MenuIcon,
} from '@mui/icons-material';

// Import contexts and providers
import { AppProvider } from './context/AppContext';
import { SettingsProvider, useSettings } from './context/SettingsContext';
import { CalendarProvider } from './context/CalendarContext';

// Import components
import LoadingOverlay from './components/LoadingOverlay';
import Notifications from './components/Notifications';

// Import pages
import Dashboard from './pages/Dashboard';
import BookingForms from './pages/BookingForms';
import Appointments from './pages/Appointments';
import Settings from './pages/Settings';

// Create default theme
const defaultTheme = createTheme({
  palette: {
    primary: {
      main: '#2271b1', // WordPress admin blue
    },
    secondary: {
      main: '#6c757d',
    },
  },
  typography: {
    fontFamily:
      '-apple-system,BlinkMacSystemFont,"Segoe UI",Roboto,Oxygen-Sans,Ubuntu,Cantarell,"Helvetica Neue",sans-serif',
  },
  shape: {
    borderRadius: 4,
  },
  components: {
    MuiAppBar: {
      styleOverrides: {
        root: {
          boxShadow: 'none',
          backgroundColor: 'transparent',
          color: '#1d2327',
          position: 'static',
        },
        positionFixed: {
          position: 'static',
          transform: 'none !important',
        },
      },
    },
    MuiDrawer: {
      styleOverrides: {
        root: {
          position: 'static',
        },
        paper: {
          position: 'static',
          height: 'auto',
          background: 'transparent',
          border: 'none',
          transform: 'none !important',
        },
        paperAnchorLeft: {
          transform: 'none !important',
        },
      },
    },
  },
});

function MainApp({ initialPage }) {
  const [mobileOpen, setMobileOpen] = React.useState(false);
  const navigate = useNavigate();
  const { settings } = useSettings();
  const isMobile = useMediaQuery(defaultTheme.breakpoints.down('sm'));

  // Create theme based on settings
  const theme = React.useMemo(
    () =>
      createTheme({
        ...defaultTheme,
        palette: {
          ...defaultTheme.palette,
          primary: {
            main:
              settings?.appearance?.primaryColor ||
              defaultTheme.palette.primary.main,
          },
          secondary: {
            main:
              settings?.appearance?.secondaryColor ||
              defaultTheme.palette.secondary.main,
          },
        },
        typography: {
          ...defaultTheme.typography,
          fontFamily:
            settings?.appearance?.fontFamily ||
            defaultTheme.typography.fontFamily,
        },
        shape: {
          ...defaultTheme.shape,
          borderRadius:
            settings?.appearance?.borderRadius ||
            defaultTheme.shape.borderRadius,
        },
      }),
    [settings?.appearance]
  );

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const menuItems = [
    { text: 'Dashboard', icon: <DashboardIcon />, path: '/dashboard' },
    { text: 'Booking Forms', icon: <DescriptionIcon />, path: '/forms' },
    { text: 'Appointments', icon: <EventNoteIcon />, path: '/appointments' },
    { text: 'Settings', icon: <SettingsIcon />, path: '/settings' },
  ];

  const drawer = (
    <div>
      <List>
        {menuItems.map((item) => (
          <ListItem
            button
            key={item.text}
            onClick={() => {
              navigate(item.path);
              if (isMobile) {
                setMobileOpen(false);
              }
            }}
          >
            <ListItemIcon>{item.icon}</ListItemIcon>
            <ListItemText primary={item.text} />
          </ListItem>
        ))}
      </List>
    </div>
  );

  React.useEffect(() => {
    // Navigate to initial page based on WordPress admin page
    const pathMap = {
      dashboard: '/dashboard',
      forms: '/forms',
      appointments: '/appointments',
      settings: '/settings',
    };
    navigate(pathMap[initialPage] || '/dashboard');
  }, [initialPage, navigate]);

  return (
    <ThemeProvider theme={theme}>
      <Box sx={{ display: 'flex' }}>
        {isMobile && (
          <AppBar
            sx={{
              position: 'relative',
              marginBottom: 2,
            }}
          >
            <Toolbar>
              <IconButton
                color="inherit"
                aria-label="open drawer"
                edge="start"
                onClick={handleDrawerToggle}
                sx={{ mr: 2 }}
              >
                <MenuIcon />
              </IconButton>
              <Typography variant="h6" noWrap component="div">
                WD Appointments
              </Typography>
            </Toolbar>
          </AppBar>
        )}

        <Drawer
          variant={isMobile ? 'temporary' : 'permanent'}
          open={isMobile ? mobileOpen : true}
          onClose={handleDrawerToggle}
          sx={{
            position: 'relative',
            width: { sm: 240 },
            flexShrink: 0,
            '& .MuiDrawer-paper': {
              position: 'relative',
              width: 240,
              height: '100%',
              border: 'none',
              borderRight: '1px solid rgba(0, 0, 0, 0.12)',
            },
          }}
        >
          {drawer}
        </Drawer>

        <Box
          component="main"
          sx={{
            flexGrow: 1,
            p: 3,
            backgroundColor: '#f0f0f1',
          }}
        >
          <Routes>
            <Route path="/dashboard" element={<Dashboard />} />
            <Route path="/forms" element={<BookingForms />} />
            <Route path="/appointments" element={<Appointments />} />
            <Route path="/settings" element={<Settings />} />
          </Routes>
        </Box>

        <Notifications />
        <LoadingOverlay />
      </Box>
    </ThemeProvider>
  );
}

// Wrap the main app with providers
function App({ initialPage }) {
  return (
    <AppProvider>
      <SettingsProvider>
        <CalendarProvider>
          <MainApp initialPage={initialPage} />
        </CalendarProvider>
      </SettingsProvider>
    </AppProvider>
  );
}

export default App;
